import React from "react";
import Navbar from "./navbar";
import MiddleText from "./middleContainer";
import CopyrightsText from "./copyrights";
import Scripts from "./bottomContainer";
import Header from "./header";
import themesPage from "./themes";

import {
  BrowserRouter as Router,
  Route,
  Switch
} from "react-router-dom";


function App() {
  // const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      // .then((data) => setData(data.message));
  }, []);

  <Router>
        <Route exact path="/themes" component={themesPage} />
    </Router>

  return (
    <div className="App">
    <Header></Header>
     <Navbar></Navbar>
     <MiddleText></MiddleText>
     <CopyrightsText></CopyrightsText>
     <Scripts></Scripts>
    </div>
  );
}

export default App;
